import SearchBar from "../SearchBar";
import * as S from "./styles";


const Header = () => {
  return (
    <S.Header>
      <img src="/images/oda-logo.jpg" />

      <SearchBar />
      <img src='/images/'/>
    </S.Header>
  );
};

export default Header;
